// 引入必要的组件
import React from 'react'
import {Outlet} from 'react-router-dom'
import { Layout } from 'antd';
const { header, footer, Sider, content } = Layout;
class App extends React.Component {

  render() {
    return (
        <Layout>
            <header>Header</header>
            <Layout>
              <Sider>Sider</Sider>
                <content>
                    <div className="App">
                        <Outlet/>
                    </div>
                </content>
          </Layout>
          <footer>Footer</footer>
    </Layout>
    );
  }
}

export default App;
